extern crate rlp_compress;

use rlp_compress::{blocks_swapper, compress, decompress, snapshot_swapper, Compressor, Decompressor, Swapper};

#[test]
fn invalid_rlp_swapper() {
    let to_swap: &[&[u8]] = &[&[0x83, b'c', b'a', b't'], &[0x83, b'd', b'o', b'g']];
    let invalid_rlp: &[&[u8]] = &[&[0x81, 0x00], &[0x81, 0x01]];
    let swapper = Swapper::new(to_swap, invalid_rlp);
    assert_eq!(Some(invalid_rlp[0]), swapper.compressed(&[0x83, b'c', b'a', b't']));
    assert_eq!(None, swapper.compressed(&[0x83, b'b', b'a', b't']));
    assert_eq!(Some(to_swap[1]), swapper.decompressed(invalid_rlp[1]));
}

#[test]
fn simple_compression() {
    let basic_account_rlp = vec![
        248, 68, 4, 2, 160, 86, 232, 31, 23, 27, 204, 85, 166, 255, 131, 69, 230, 146, 192, 248, 110, 91, 72, 224, 27,
        153, 108, 173, 192, 1, 98, 47, 181, 227, 99, 180, 33, 160, 197, 210, 70, 1, 134, 247, 35, 60, 146, 126, 125,
        178, 220, 199, 3, 192, 229, 0, 182, 83, 202, 130, 39, 59, 123, 250, 216, 4, 93, 133, 164, 112,
    ];
    let compressed = compress(&basic_account_rlp, snapshot_swapper());
    assert_eq!(compressed.to_vec(), vec![198, 4, 2, 129, 0, 129, 1]);
    let decompressed = decompress(&compressed, snapshot_swapper());
    assert_eq!(decompressed.to_vec(), basic_account_rlp);
}

#[test]
fn nested_list_rlp() {
    let nested_basic_account_rlp = vec![
        228, 4, 226, 2, 160, 86, 232, 31, 23, 27, 204, 85, 166, 255, 131, 69, 230, 146, 192, 248, 110, 91, 72, 224, 27,
        153, 108, 173, 192, 1, 98, 47, 181, 227, 99, 180, 33,
    ];

    let compressed = compress(&nested_basic_account_rlp, blocks_swapper());
    assert_eq!(compressed, vec![197, 4, 195, 2, 129, 0]);
    let decompressed = decompress(&compressed, blocks_swapper());
    assert_eq!(decompressed, nested_basic_account_rlp);
    let compressed = compress(&nested_basic_account_rlp, snapshot_swapper());
    assert_eq!(compressed, vec![197, 4, 195, 2, 129, 0]);
    let decompressed = decompress(&compressed, snapshot_swapper());
    assert_eq!(decompressed, nested_basic_account_rlp);
}

